@-moz-document domain("roblox.com") {
#LogoAndSlogan {
    display: Block;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    background: url("http://i.imgur.com/bVV71UU.png");
    width: 490px;
    height: 261px;
    padding-left: 490px;
}
#RollerContainer {
    background: url(https://images.rbxcdn.com/dcbdfaf1c08058e71f65c09f7b98ff04.jpg);
}
.robloxLogo {
    display: Block;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    background-image: url("https://images.rbxcdn.com/e870a0b9bcd987fbe7f730c8002f8faa.png");
    background-size: 36px, 36px;
    width: 36px;
    height: 36px;
    padding-left: 36px;
}
.icon-logo {
    background-image: url(http://i.imgur.com/bVV71UU.png);
}
.icon-logo-r {
    background-image: url(http://imgur.com/1Nj6NaZ.png);
}
}
